import polars as pl


df = pl.read_csv("/root/.cache/kagglehub/datasets/uom190346a/sleep-health-and-lifestyle-dataset/versions/2/Sleep_health_and_lifestyle_dataset.csv")
df.head()

df.tail()

df.describe()

df.schema

numeric_cols = [
    "Person ID", "Age", "Sleep Duration", "Quality of Sleep",
    "Physical Activity Level", "Stress Level", "Heart Rate", "Daily Steps"
]

for col in numeric_cols:
    mean_val = df.select(pl.mean(col)).item()
    df = df.with_columns([
        pl.col(col).fill_null(mean_val)
    ])

df.head()

"""# **Gender Distribution Male and Female in the dataset.**"""

import plotly.express as px

male_count = df.filter(pl.col("Gender") == "Male").height
female_count = df.filter(pl.col("Gender") == "Female").height

fig = px.pie(
    names=["Male", "Female"],
    values=[male_count, female_count],
    title="Gender Distribution"
)
fig.show()

# Extract Gender and Age columns as Python lists
genders = df["Gender"].to_list()
ages = df["Age"].to_list()

fig = px.box(
    x=genders,
    y=ages,
    title="Distribution of Age by Gender",
    labels={"x": "Gender", "y": "Age"}
)
fig.show()

"""Creating a new column Sleep Quality Index by combining sleep duration and quality of sleep"""

df = df.with_columns([
    (pl.col("Sleep Duration") * pl.col("Quality of Sleep")).alias("Sleep Quality Index")
])
min_duration = df.select(pl.col("Sleep Duration").min()).item()
max_duration = df.select(pl.col("Sleep Duration").max()).item()

min_quality = df.select(pl.col("Quality of Sleep").min()).item()
max_quality = df.select(pl.col("Quality of Sleep").max()).item()

print("Raw Sleep Quality Index will range approximately from:",
      min_duration * min_quality, "to", max_duration * max_quality)

df.head()

"""# **Sleep Quality Index VS Age**"""

ages = df["Age"].to_list()
sqi = df["Sleep Quality Index"].to_list()

# Create a scatter plot
fig = px.scatter(
    x=ages,
    y=sqi,
    title="Age vs. Sleep Quality Index",
    labels={"x": "Age", "y": "Sleep Quality Index"}
)
fig.show()

# Extract Gender and Sleep Quality Index columns as lists
genders = df["Gender"].to_list()
sqi = df["Sleep Quality Index"].to_list()

# Create a box plot to show the distribution
fig = px.box(
    x=genders,
    y=sqi,
    title="Distribution of Sleep Quality Index by Gender",
    labels={"x": "Gender", "y": "Sleep Quality Index"}
)
fig.show()

"""# **Physical Activity  vs Quality of Sleep**"""

import plotly.express as px
import plotly.graph_objects as go
import numpy as np
from sklearn.linear_model import LinearRegression

pa = np.array(df["Physical Activity Level"].to_list()).reshape(-1, 1)
sqi = np.array(df["Sleep Quality Index"].to_list())

model = LinearRegression()
model.fit(pa, sqi)

x_line = np.linspace(min(pa), max(pa), 100)
y_line = model.predict(x_line)


fig = go.Figure()

fig.add_trace(go.Scatter(
    x=df["Physical Activity Level"].to_list(),
    y=df["Sleep Quality Index"].to_list(),
    mode='markers',
    name="Data Points",
    marker=dict(color='blue', size=6)  # Data point style
))


fig.add_trace(go.Scatter(
    x=x_line.flatten(),
    y=y_line,
    mode='lines',
    name="Regression Line",
    line=dict(color='red', dash='dot', width=2)  # Dotted red line
))

fig.update_layout(
    title="Sleep Quality Index vs. Physical Activity Level with Dotted Regression Line",
    xaxis_title="Physical Activity Level",
    yaxis_title="Sleep Quality Index",
    showlegend=True
)

fig.show()

df = df.with_columns(
    pl.col("BMI Category").replace({"Normal": "Normal Weight", "Normal Weight": "Normal Weight"})
)

# Group by BMI Category and count the rows
bmi_counts = df.group_by("BMI Category").agg(pl.count().alias("Count"))

# Create a bar chart with different colors for each category
fig = px.bar(
    bmi_counts.to_pandas(),  # Convert to pandas for Plotly
    x="BMI Category",
    y="Count",
    color="BMI Category",  # Different colors for each category
    title="BMI Category Distribution with Combined Normal Weight",
    labels={"Count": "Number of Individuals", "BMI Category": "BMI Category"}
)

fig.show()

heart_rate = df["Heart Rate"].to_list()
blood_pressure = df["Blood Pressure"].to_list()
bmi_category = df["BMI Category"].to_list()

# If Blood Pressure is stored as "120/80", split it into systolic values
df = df.with_columns([
    pl.col("Blood Pressure").str.split("/").list.get(0).cast(pl.Int64).alias("Systolic BP")
])

# Create 3D scatter plot
fig = px.scatter_3d(
    x=heart_rate,
    y=df["Systolic BP"].to_list(),
    z=bmi_category,
    color=bmi_category,
    title="3D Plot: Heart Rate vs Blood Pressure vs BMI Category",
    labels={"x": "Heart Rate", "y": "Systolic Blood Pressure", "z": "BMI Category"},
)

fig.show()

"""# **Sleep Disorder**"""

sleep_disorder_counts = df.group_by("Sleep Disorder").agg(pl.count().alias("Count"))

# Convert to pandas for Plotly Express
sleep_disorder_counts_pd = sleep_disorder_counts.to_pandas()

# Create a bar chart
fig = px.bar(
    sleep_disorder_counts_pd,
    x="Sleep Disorder",
    y="Count",
    title="Distribution of Sleep Disorders",
    labels={"Count": "Number of Individuals", "Sleep Disorder": "Sleep Disorder Status"},
    color="Sleep Disorder"  # Different colors for categories
)
fig.show()

bmi_sleep_counts = (
    df.group_by(["BMI Category", "Sleep Disorder"])
    .agg(pl.count().alias("Count"))
)

# Calculate total counts per BMI Category
total_counts = (
    bmi_sleep_counts.group_by("BMI Category")
    .agg(pl.sum("Count").alias("Total"))
)

# Join total counts back to the grouped counts
bmi_sleep_percentages = bmi_sleep_counts.join(total_counts, on="BMI Category").with_columns(
    ((pl.col("Count") / pl.col("Total")) * 100).alias("Percentage")
)

# Convert to pandas for Plotly Express
bmi_sleep_percentages_pd = bmi_sleep_percentages.to_pandas()

# Create a grouped bar chart with percentages
fig = px.bar(
    bmi_sleep_percentages_pd,
    x="BMI Category",
    y="Percentage",
    color="Sleep Disorder",
    barmode="group",  # Group bars by Sleep Disorder
    title="Relative Percentage of Sleep Disorders by BMI Category",
    labels={"Percentage": "Percentage (%)", "BMI Category": "BMI Category", "color": "Sleep Disorder"}
)

fig.show()

