# Step 1: Add "Steps Range" column by categorizing Daily Steps
df = df.with_columns(
    pl.when(pl.col("Daily Steps") < 4000).then(pl.lit("Low Steps (<4k)"))
    .when((pl.col("Daily Steps") >= 4000) & (pl.col("Daily Steps") < 8000)).then(pl.lit("Moderate Steps (4k-8k)"))
    .when((pl.col("Daily Steps") >= 8000) & (pl.col("Daily Steps") < 12000)).then(pl.lit("High Steps (8k-12k)"))
    .otherwise(pl.lit("Very High Steps (>12k)"))
    .alias("Steps Range")
)

# Step 2: Split Blood Pressure into Systolic BP
df = df.with_columns([
    pl.col("Blood Pressure").str.split("/").list.get(0).cast(pl.Int64).alias("Systolic BP")
])

# Step 3: Convert to pandas for Plotly Express
df_pandas = df.to_pandas()

# Step 4: Create a facet grid of box plots for Heart Rate and Systolic BP
fig = px.box(
    df_pandas,
    x="Steps Range",
    y="Heart Rate",
    color="Steps Range",
    facet_col="Steps Range",
    title="Heart Rate Distribution Across Steps Ranges",
    labels={"Heart Rate": "Heart Rate (bpm)", "Steps Range": "Steps Range"},
    boxmode="overlay"  # Better layout for overlapping boxes
)
fig.show()

# Step 5: Add a second visualization for Blood Pressure
fig2 = px.box(
    df_pandas,
    x="Steps Range",
    y="Systolic BP",
    color="Steps Range",
    facet_col="Steps Range",
    title="Blood Pressure Distribution Across Steps Ranges",
    labels={"Systolic BP": "Systolic Blood Pressure", "Steps Range": "Steps Range"},
    boxmode="overlay"
)
fig2.show()

"""Risk factors for diseases :"""

df_enriched = df.clone()

# Extract Systolic BP from Blood Pressure
df_enriched = df_enriched.with_columns([
    pl.col("Blood Pressure").str.split("/").list.get(0).cast(pl.Int64).alias("Systolic BP")
])

# Convert to a dictionary or directly feed lists to Plotly
heart_rate = df_enriched["Heart Rate"].to_list()
systolic_bp = df_enriched["Systolic BP"].to_list()
sleep_quality_index = df_enriched["Sleep Quality Index"].to_list()
sleep_disorder = df_enriched["Sleep Disorder"].to_list()  # e.g. "Yes"/"No"

# Create a 3D scatter plot
fig = px.scatter_3d(
    x=heart_rate,
    y=systolic_bp,
    z=sleep_quality_index,
    color=sleep_disorder,
    title="3D Visualization: Heart Rate, Blood Pressure, and Sleep Quality Index by Sleep Disorder",
    labels={
        "x": "Heart Rate (bpm)",
        "y": "Systolic Blood Pressure (mmHg)",
        "z": "Sleep Quality Index"
    }
)

fig.show()

